textOriginal:
Levaram meu vizinho que era judeu. Mas como não sou judeu, não me incomodei;

Dia seguinte, levaram outro vizinho evangélico. Mas como não sou evangélico, não me incomodei;

No terceiro dia levaram meu vizinho católico. Mas como não sou católico, não me incomodei;

No quarto dia, me levaram.

Do jeito que o PT e o Lula gostam de entregar obras pela metade…

Estão prometendo picanha, mas só vão entregar a pica…
